INSERT INTO `carves` (`id`, `name`, `monster`, `rare`, `sell`, `description`) VALUES
(1, 'Akantor Carapace', 'Akantor', 6, 5580, 'Shining Akantor Shell. Exceptionally hard, and thus difficult to craft.'),
(2, 'Akantor Cortex', 'Akantor', 8, 13950, 'Bulky plating with a faint glow. Deters most attacks and repels the rest.'),
(3, 'Akantor Flail', 'Akantor', 8, 20000, 'A barbed tail that razes the earth and knocks the fight right out of prey.'),
(4, 'Akantor Gem', 'Akantor', 7, 15000, 'A gem that once belonged to the Ancient World-King. Its aura resists new ownership.'),
(5, 'Akantor Greatfang', 'Akantor', 8, 21250, 'One of a pair of towering fangs. The hard base makes it ideal equipment material.'),
(6, 'Akantor Hardclaw', 'Akantor', 6, 5700, 'Hard Akantor claw that can smash bedrock. Its victims are left unrecognizable.'),
(7, 'Akantor Scale+', 'Akantor', 6, 4272, 'Faintly glittering Akantor Scale. It will not melt, even if dipped in lava.'),
(8, 'Akantor Shard', 'Akantor', 8, 10680, 'A splendid scale with a faint glow. Requires cooling after all that time in lava'),
(9, 'Akantor Shredtalon', 'Akantor', 8, 14250, 'An earth-shredding claw that destroys anything caught in the Akantor''s charge.'),
(10, 'Akantor Spike', 'Akantor', 6, 9500, 'A flawless spike from an Akantor. It can easily scar rock.'),
(11, 'Akantor Tail', 'Akantor', 6, 8000, 'The large rock-like tail of an Akantor. Strong enough to gouge the earth.'),
(12, 'Akantor Tallfang', 'Akantor', 6, 8500, 'Huge fang that can pierce the heavens. It has passed through many foes.'),
(13, 'Akantor Thickspike', 'Akantor', 8, 23750, 'A thick, sturdy shell spike believed to have evolved as defense against larger foes.'),
(14, 'Conquest Sphere', 'Akantor', 9, 30000, 'A gem said to grant dominion over everything under the sun. Courses with ambition.'),
(15, 'Rhenoplos Bone', 'Apceros', 8, 1080, 'As strong as it is heavy, this Rhenoplos bone is well-suited for use in crafting armor.'),
(16, 'Basarios Carapace', 'Basarios', 6, 1320, 'Harder than Basarios shell, this material is also known as Gravite.'),
(17, 'Basarios Cortex', 'Basarios', 8, 3960, 'A heavy Basarios shell encrusted with quality ore. Perfectly mimics a stone wall.'),
(18, 'Basarios Fellwing', 'Basarios', 8, 11000, 'A top-grade Basarios wing. It''s not great for flying, but highly sought after as material.'),
(19, 'Basarios Shell', 'Basarios', 4, 440, 'Shell from a Basarios. Rock-like consistency. Can be forged into metal.'),
(20, 'Basarios Tears', 'Basarios', 6, 8888, 'Faintly pink gems found near the tear ducts of a Basarios.'),
(21, 'Basarios Wing', 'Basarios', 4, 1420, 'The wing of a Basarios. Very hard to work as a material.'),
(22, 'Lrg Wyvern Gem', 'Basarios', 9, 12000, 'A Wyvern Gem grown especially large after years of collecting mass. Emits a peculiar glow.'),
(23, 'Wyvern Gem', 'Basarios', 7, 6000, 'Throughout a wyvern''s life, impurities gather and form this peculiar gem.'),
(24, 'Lrg Wyvern Gem', 'Basarios (Ruby)', 9, 12000, 'A Wyvern Gem grown especially large after years of collecting mass. Emits a peculiar glow.'),
(25, 'R.Basarios Carapace', 'Basarios (Ruby)', 6, 1860, 'The rock-hard shell of a Ruby Basarios. Hunters line up for its pink ore.'),
(26, 'R.Basarios Cortex', 'Basarios (Ruby)', 8, 5580, 'Bulky plating containing quality ore that allows for more precise mimicry.'),
(27, 'R.Basarios Fellwing', 'Basarios (Ruby)', 8, 14300, 'A quality wing containing a special metal in the claw. Rare, fascinating material.'),
(28, 'R.Basarios Wing', 'Basarios (Ruby)', 6, 2080, 'A gold wing from the newly- discovered Ruby Basarios. Wondrous and valuable.'),
(29, 'Wyvern Gem', 'Basarios (Ruby)', 7, 6000, 'Throughout a wyvern''s life, impurities gather and form this peculiar gem.'),
(30, 'Bnahabra Carapace', 'Bnahabra', 6, 360, 'The hardest part of the shell. Reveals curious properties when forged.'),
(31, 'Bnahabra Razorwing', 'Bnahabra', 8, 675, 'A wing that slices like a well-honed knife. Difficult to use in forging.'),
(32, 'Bnahabra Shell', 'Bnahabra', 4, 120, 'Just as useful as sturdy wyvern shell in the hands of a clever craftsman.'),
(33, 'Bnahabra Wing', 'Bnahabra', 4, 75, 'Difficult to forge with -- the results vary depending on which surface you use.'),
(34, 'Brach Carapace', 'Brachydios', 6, 1500, 'A hard Brachydios carapace. Glossy like obsidian, it adds a refined beauty to crafted gear.'),
(35, 'Brach Cortex', 'Brachydios', 8, 4500, 'Thick cortex of a Brachydios. Its stoic beauty adds strength and dignity to equipment.'),
(36, 'Brach Crown', 'Brachydios', 8, 7290, 'A large head projection that continually produces potent slime from within.'),
(37, 'Brach Ebonshell', 'Brachydios', 4, 980, 'An obsidian Brachydios brace. Makes especially strong armor, perhaps due to the slime mold.'),
(38, 'Brach Ebonshell+', 'Brachydios', 6, 1900, 'An obsidian shell from the foreleg. It has evolved to withstand slime blasts.'),
(39, 'Brach Gem', 'Brachydios', 7, 9300, 'A rare gem from a Brachydios. Perhaps the secret of its dreadful slime is hidden inside?'),
(40, 'Brach Hammer', 'Brachydios', 4, 1280, 'An arm that has crushed the courage out of many a hunter. Slime makes forging tricky.'),
