(1, 'Book of Combos 1', 'Tool', '', 4, 1, 0, 100, 'An introductory text for first-time combiners. Improves your success rate.'),
(2, 'Book of Combos 2', 'Tool', '', 4, 1, 0, 200, 'A basic text. Owning Book 1 and this improves your combining success rate.'),
(3, 'Book of Combos 3', 'Tool', '', 4, 1, 0, 500, 'An intermediate text. Owning Books 1, 2 and this improves your combining success rate.'),
(4, 'Book of Combos 4', 'Tool', '', 5, 1, 0, 1000, 'An advanced text. Owning Books 1-3 and this improves your combining success rate.'),
(5, 'Book of Combos 5', 'Tool', '', 5, 1, 0, 1500, 'A pro-level text. Owning Books 1-4 and this improves your combining success rate.'),
(6, 'Organizer Guide', 'Book', '', 4, 1, 0, 0, 'An issue of Hunting Life magazine which explains how to maximize Item Box space.'),
(7, 'Pack Rat Guide', 'Book', '', 5, 1, 0, 0, 'An issue of Hunting Life magazine containing advanced item-cramming techniques.'),
(8, 'Potion', 'Consumable', '', 1, 10, 0, 7, 'Restores a small amount of Health. Try to combine these into something Mega-better!'),
(9, 'Mega Potion', 'Consumable', '', 2, 10, 0, 16, 'Restores a moderate amount of Health. This potion is a hunter&#39;s best friend.'),
(10, 'Nutrients', 'Consumable', '', 2, 5, 0, 25, 'Very slightly increases your maximum Health level.'),
(11, 'Mega Nutrients', 'Consumable', '', 3, 5, 0, 92, 'Slightly increases your maximum Health level.'),
(12, 'Antidote', 'Consumable', '', 1, 10, 0, 6, 'Removes all traces of poison from your system.'),
(13, 'Immunizer', 'Consumable', '', 3, 10, 0, 92, 'Boosts your natural ability to heal.'),
(14, 'Dash Juice', 'Consumable', '', 2, 5, 0, 29, 'Lets you run without tiring for a short period of time.'),
(15, 'Mega Dash Juice', 'Consumable', '', 3, 5, 0, 205, 'Lets you run without tiring for longer than with regular Dash Juice.'),
(16, 'Demondrug', 'Consumable', '', 4, 5, 0, 67, 'Boosts your Attack by filling you with -- guess what? -- demonic strength.'),
