(18, 'Might Pill', 'Consumable', '', 1, 5, 0, 280, 'Temporarily endows you with the strength of a mighty god. Potent!'),
(19, 'Armorskin', 'Consumable', '', 4, 5, 0, 58, 'Boosts your Defense by turning your skin as hard as rock.'),
