(23, 'Hot Drink', 'Consumable', '', 1, 5, 0, 25, 'Provides temporary relief from extreme cold.'),
(24, 'Cleanser', 'Consumable', '', 2, 10, 0, 14, 'Immediately removes any ice or mud on your body. Clean as a whistle!'),
